/**
 * Enum that animation effect.
 * @name Effect
 * @enum {string} Effect
 */

/**
 * Align to none effect.
 * value = 'none'
 * @constant
 * @memberof Effect
 */
export const NONE = 'none';

/**
 * Align to fade effect.
 * value = 'fade'
 * @constant
 * @memberof Effect
 */
export const FADE = 'fade';

/**
 * Align to slide effect.
 * value = 'slide'
 * @constant
 * @memberof Effect
 */
export const SLIDE = 'slide';

/**
 * Align to zoom effect.
 * value = 'zoom'
 * @constant
 * @memberof Effect
 */
export const ZOOM = 'zoom';
